Sandra Shine Sophie Moon

Wed July 07, 2010
Sandra comes to stay at our apartment for a few weeks. She isnt interested in paying her rent in cash. She calls over a friend to assist her in making a video in exchange for a place to stay. They brought toys and the determination to get a great deal. Were sure they are going to earn it.
